const initialState = {
    models: []
}

export default function alarmReducer(state = initialState, action) {
    switch (action.type) {
        case 'RECEIVE_ALL_CARS': {
            return {
                ...state,
                models: action.list
            }
        }
        default:{
            return {
                ...state
            }
        }

    }
}
